import React, {Component} from 'react'
import './navbar'
import Navbar from './navbar'
class App extends Component {

    constructor(props) {
        super(props)
        this.state = {
            account : '0x0'
        }
    }

    render() {
        return (
            <div>
                <Navbar account={this.state.account} />
            <div>
                Hello World
            </div>
            </div>
        )
    }
}

export default App;
